
        CREATE TABLE IF NOT EXISTS agents (
     `id` INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
     `id_agent` INTEGER NOT NULL,
     `agent` VARCHAR(250) NOT NULL,
     `attente` INTEGER NOT NULL DEFAULT 0,
     `traitement` INTEGER NOT NULL DEFAULT 0,
     `post_travail` INTEGER NOT NULL DEFAULT 0,
     `nb_argu` INTEGER NOT NULL DEFAULT 0,
     `heure` INTEGER NOT NULL DEFAULT 0,
     `nb_req` INTEGER NOT NULL DEFAULT 0,
     `traite_voix` INTEGER NOT NULL DEFAULT 0,
     `heure_paye` INTEGER NOT NULL DEFAULT 0,
     `heure_total` INTEGER NOT NULL DEFAULT 0,
     `sph` INTEGER NOT NULL DEFAULT 0,
     `tmt` INTEGER NOT NULL DEFAULT 0,
     `pause` INTEGER NOT NULL DEFAULT 0,
     `dates` VARCHAR(250) NOT NULL
     );
  USE agent;
          
